import React, { useState, useEffect } from 'react';
import { motion } from 'framer-motion';
import { API_URL } from '../api';
import './Kontakt.css';

function Kontakt() {
  const [form, setForm] = useState({ name: '', email: '', message: '' });
  const [status, setStatus] = useState('idle');

  useEffect(() => {
    const params = new URLSearchParams(window.location.search);
    const subject = params.get('subject');
    if (subject) {
      setForm((f) => ({ ...f, message: `Angående: ${subject}\n\n` }));
    }
  }, []);

  async function submit(e) {
    e.preventDefault();
    if (!form.name || !form.email || !form.message) {
      setStatus('validation-error');
      return;
    }
    setStatus('sending');
    try {
      const res = await fetch((API_URL || '') + '/contact', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(form),
      });
      if (!res.ok) throw new Error('Network response was not ok');
      setStatus('sent');
      setForm({ name: '', email: '', message: '' });
    } catch (err) {
      console.error(err);
      setStatus('error');
    }
  }

  return (
    <motion.section
      className="kontakt-section"
      initial={{ y: 8, opacity: 0 }}
      animate={{ y: 0, opacity: 1 }}
      transition={{ duration: 0.45 }}
    >
      <div className="kontakt-container">
        <div className="kontakt-left">
          <div className="eyebrow">Kontakt</div>
          <h1 className="kontakt-title">Hör av dig — vi hjälper dig vidare</h1>
          <p className="kontakt-lead">Fyll i formuläret så återkommer vi vanligtvis inom 24 timmar.</p>

          <form className="kontakt-form" onSubmit={submit} aria-label="Kontaktformulär">
            <label>
              Namn
              <input aria-label="Namn" placeholder="Namn" value={form.name} onChange={(e) => setForm({ ...form, name: e.target.value })} />
            </label>

            <label>
              E-post
              <input aria-label="E-post" placeholder="E-post" type="email" value={form.email} onChange={(e) => setForm({ ...form, email: e.target.value })} />
            </label>

            <label>
              Meddelande
              <textarea aria-label="Meddelande" placeholder="Meddelande" rows={6} value={form.message} onChange={(e) => setForm({ ...form, message: e.target.value })} />
            </label>

            <div className="form-actions">
              <button className="btn-primary" type="submit" aria-live="polite">Skicka meddelande</button>
              <div className="status-msg">
                {status === 'sending' && <span>Skickar...</span>}
                {status === 'sent' && <span className="ok">Tack! Meddelandet skickades.</span>}
                {status === 'error' && <span className="err">Fel vid skickning. Försök senare.</span>}
                {status === 'validation-error' && <span className="warn">Fyll i alla fält.</span>}
              </div>
            </div>
          </form>
        </div>

        <aside className="kontakt-right">
          <div className="card contact-card">
            <h3>Kontaktuppgifter</h3>
            <p className="muted">One Redovisning Stockholm AB</p>
            <p>
              <strong>Adress:</strong> Storgatan 1, 111 22 Stockholm
            </p>
            <p>
              <strong>Telefon:</strong> <a href="tel:+46123456789">+46 12 345 67 89</a>
            </p>
            <p>
              <strong>E-post:</strong> <a href="mailto:info@one-redovisning.se">info@one-redovisning.se</a>
            </p>
          </div>

          <div className="card hours-card">
            <h4>Öppettider</h4>
            <p className="muted">Måndag–Fredag</p>
            <p>08:30 — 17:00</p>
          </div>

          <div className="card map-card">
            <h4>Hitta hit</h4>
            <div className="map-placeholder">Karta (placeholder)</div>
          </div>
        </aside>
      </div>
    </motion.section>
  );
}

export default Kontakt;
